import React, { Component } from 'react';

class Playlist extends Component {
  render() {
    return (
      <div className="col-6">
        <div className="tile double totoro">
          <div className="player text-left">
            <h4>
              Shower Order:
              <div>- Jackeline</div>
              <div>- Juan</div>
              <div>- Manuel</div>
            </h4>
          </div>
        </div>
      </div>
    );
  }
}

export default Playlist;
